v3 v2
Copy Copied
```
import { EventSchemas , Inngest } from "inngest" ;

type UserSignup = {
data : {
email : string ;
name : string ;
};
};
type Events = {
"user/new.signup" : UserSignup ;
};

export const inngest = new Inngest ({
id : "my-app" ,
schemas : new EventSchemas () .fromRecord < Events >() ,
});
```

